import Header from '../components/header'
import Footer from '../components/footer'
import styles from '../styles/home.module.sass'

const Homepage = ({ t }) => (
  <>
    <main>
      <Header/>
      {/* <div>
        <button
          type='button'
          onClick={() => i18n.changeLanguage(i18n.language === 'en' ? 'de' : 'en')}
