        </button>
      </div> */}
      <div className="langContainer">
      <button className="langBtn" type="button" onClick={() => i18n.changeLanguage("de")}>
        {t("translation:de")}
      </button>

      <button className="langBtn" type="button" onClick={() => i18n.changeLanguage("en")}>
        {t("translation:en")}
</button>
</div>
    </main>
    <Footer />
  </>
)

Homepage.getInitialProps = async () => ({
  namespacesRequired: ['common'],
})

Homepage.propTypes = {
  t: PropTypes.func.isRequired,
}

export default withTranslation('common')(Homepage)
